Ohio Slave Girls: Their Story

Sociopolitical Documentary hosted by Andy Dunn and Oliver Price, published by Channel 5 in 2013 - English narration


Information
------------------------------

Documentary about the three young women who were kidnapped and held captive in a cellar in suburban Cleveland, Ohio for 11 years. What happened when they were taken, and what did Ariel Castro, the man charged with snatching them, want from these young women? What control did their captor hold over them and how did he prevent them from trying to call for help? Through exclusive interviews with neighbours and family witnesses, expert psychologists and criminologists, the programme explores the psychology of how one man succeeded in persuading the women to live as captives for so long and examines the long-term effects of this most traumatic of experiences.

An ITN production for Channel 5

